import React from 'react'

const ProjectCard = () => {
  let images = [
    {img: "images/kalios-img.png", url: "https://www.linkedin.com/in/javierviolante/"},
  ]

    const titleStyle = {
        color: "#7fccbd",
        fontSize: "20pt",
        fontWeight: "normal",
        margin: "0px"
    }

    const descStyle = {
        color: "white",
        fontSize: "14pt",
        fontWeight: "normal",
        padding: "10px"
    }

    const imgStyle = {
      width: "95%"
    }

  return (
    <div className="project-card">
        <img style={imgStyle} src="images/kalios-img.png" alt="Test"></img>
        <h1 style={titleStyle}>Title</h1>
        <h2 style={descStyle}>Desc</h2>
    </div>
  )
}

export default ProjectCard
